import React from "react";
import styles from "./Main.module.css"
import Product from "../Product/Product";
import ProductContainer from "../Product/ProductContainer";

const Main = (props) => {
if(props.Search!==""){
    let AppleElementSearch = props.apple.filter(f=>f.Search===props.apple.name).map(ae=><ProductContainer key={ae.id} {...ae}/>)
    let XiaomiElementSearch = props.xiaomi.filter(f=>f.Search===props.xiaomi.name).map(ae=><ProductContainer key={ae.id} {...ae}/>)
    return<div>
        {AppleElementSearch}
        {XiaomiElementSearch}
    </div>
}
    let AppleElements = props.apple.map(ae=><ProductContainer key={ae.id} {...ae}/>)
    let XiaomiElements = props.xiaomi.map(ae=><ProductContainer key={ae.id} {...ae}/>)

    let SearchElements=props.Search.filter(f=>f.search===props.apple.name && props.xiaomi.name).map(m=>m.search)

    return <div className={styles.main}>
        <div>Apple</div>
        <div>
            {AppleElements}
        </div>

        <div>
            Xiaomi
        </div>
        <div>
            {XiaomiElements}
        </div>
        {SearchElements}

    </div>
}

export default Main;
